import React, { Component } from 'react';
import { LayoutMenuLinkGroup, LayoutMenuLink } from 'shipnow-mercurio';

import withStore from '../../hocs/withStore';
import { withRouter } from 'react-router';

class AppointmentsMenu extends Component {

  constructor(props) {
    super(props);

    const path = this.props.match.path;

    this.props.store.ui.registerRoute(`${path}/appointments`, 'Turnos');

  }

  render() {
    const path = this.props.match.path;

    return(
      <LayoutMenuLinkGroup icon="question" invert label="Turnos" basePath={ `${path}/appointments/` }>
        <LayoutMenuLink to={ `${path}/apointments/list`   }>Listado</LayoutMenuLink>
        <LayoutMenuLink to={ `${path}/apointments/reports`   }>Reportes</LayoutMenuLink>
      </LayoutMenuLinkGroup> )
  };

}

export default withStore(withRouter(AppointmentsMenu));
